import React from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText,
} from 'reactstrap';

const Navs = () => {
    return (
        <div>
            <Navbar>
                <NavbarBrand href="/"> <img src="images/Group%20357.png" alt=""/></NavbarBrand>

                    <Nav className="me-auto d-flex" navbar>
                        <NavItem>
                            <NavLink href="/components/">Components</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="/components/">Components</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="/components/">Components</NavLink>
                        </NavItem>


                    </Nav>


            </Navbar>
        </div>
    );
};

export default Navs;
